{"title":"Section: progression intermédiaire vers l'autonomie","type":"markdown","aggs":[],"params":{"fontSize":12,"openLinksInNewTab":false,"markdown":"## **Progression intermédiaire des jeunes vers leur autonomie**

En amont de l’autonomie, l’accompagnement de la ML peut créer de l’intérêt (atteinte du niveau 1), de la connaissance (atteinte du niveau 2) et/ou de la mobilisation accompagnée (atteinte du niveau 3). Ces graphs montrent pour chaque domaine le nombre de jeunes qui ont accédé à ces étapes intermédiaires.

Un niveau intermédiaire est atteint pour un domaine s’il est atteint pour au moins 2 des 3 capacités du domaine en question."}}

{"title":"Section: marges de progrès et résultats","type":"markdown","aggs":[],"params":{"fontSize":12,"openLinksInNewTab":false,"markdown":"## **Synthèse des marges de progrès des jeunes et des résultats de leur accompagnement**

Bloc de gauche : Marge de progrès par domaine et niveau d’autonomie : Pour chaque domaine (en colonne), ce graph indique le nombre de jeunes qui avaient besoin d’être accompagnés vers l’une ou l’autre des étapes de l’autonomie (en ligne). Ex. le croisement de la 2eme ligne et de la 3eme colonne indique le nombre de jeunes qui n’avaient pas encore de connaissance du domaine de la formation au début de leur accompagnent ; le croisement de la 4eme ligne et de la dernière colonne indique le nombre de jeunes qui n’étaient pas encore autonomes pour leur accès à la santé au début de leur accompagnement.

Bloc de droite : Progrès réalisés par domaine et niveau d’autonomie : Pour chaque domaine (en colonne), ce graph indique la part des jeunes qui ont progressé vers l’une ou l’autre des étapes de l’autonomie (en ligne) sur la période d’expérimentation parmi ceux qui avaient cette marge de progrès. Ex. le croisement de la 2eme ligne et de la 3eme colonne indique le pourcentage de jeune qui ont développé de la connaissance dans le domaine de la formation parmi ceux qui n’en avaient pas avant ; le croisement de la 4eme ligne et de la dernière colonne indique la part de jeunes qui sont devenus autonomes dans leur accès à la santé parmi ceux qui ne l’étaient pas avant."}}
